        "Routes",
        `login=${typeof login}`,
        `register=${typeof register}`,
    );

  console.log("routes loaded");

    return (
      <div className="pt-5">
        <Switch>

          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/login">
            <LoginForm />
          </Route>

          <Route exact path="/signup">
            <SignupForm />
          </Route>

          <Route exact path="/companies">
            <Companies />
          </Route>

          <Route exact path="/jobs">
            <Jobs />
          </Route>

          <Route exact path="/companies/:handle">
            <CompanyDetails />
          </Route>

          <Route path="/profile">
            <ProfileForm />
          </Route>

          <Redirect to="/" />
        </Switch>
      </div>
  );
}

export default RoutesList;
